import styled from 'styled-components';

export const Container = styled.div`
    position: absolute;
    top: 0;
    left: 0;
    height: 100vh;
    max-width: 25rem;
    width: 100%;
    background-color: #F9F6F0;

    .head {
        width: 100%;
        height: 5.625rem;
        background-color: #161616;
        text-align: right;
        padding-top: 1.4rem;

        .close {
            margin: 0 1.2rem;
        }
    }

    ul {

        width: 100%;

        .menu {

            color: #444c54;
            padding: 1rem;

            ul.subMenu {
                display: none;
            }
        }

        li {
            width: 100%;
            padding: 1rem;

            a {
                display: inline-flex;
                width: 100%;
                height: 100%;
                text-decoration: none;
                color: #444c54;
                background-color: blue; //rgba(249, 246, 240, 0.7);
            }
        }
    }
`;
